<?php

namespace App\Console\Commands;

use Illuminate\Console\Command;
use Illuminate\Support\Facades\DB;
use Illuminate\Support\Facades\Storage;

class ResetDemo extends Command
{
    /**
     * The name and signature of the console command.
     *
     * @var string
     */
    protected $signature = '2fauth:reset-demo {--no-confirm}';

    /**
     * The console command description.
     *
     * @var string
     */
    protected $description = 'Reset 2FAuth with a fresh demo content';

    /**
     * Create a new command instance.
     *
     * @return void
     */
    public function __construct()
    {
        parent::__construct();
    }

    /**
     * Execute the console command.
     *
     * @return mixed
     */
    public function handle()
    {
        if( !config('app.options.isDemoApp') ) {
            $this->comment('2fauth:reset-demo can only run when isDemoApp option is On');
            return;
        }

        if( $this->option('no-confirm') ) {
            $demo = 'demo';
        }
        else {
            $this->line('This will reset the app in order to run a clean and fresh demo.');
            $demo = $this->ask('To prevent any mistake please type the word "demo" to go on');
        }

        if ($demo === 'demo') {

            // Delete all icons
            $filesForDelete = \Illuminate\Support\Facades\File::glob('public/icons/*.png');
            Storage::delete($filesForDelete);

            $this->line('Existing icons deleted');

            // Regenerate icons for seeded accounts
            $this->generateIcon('amazon', self::AMAZON);
            $this->generateIcon('apple', self::APPLE);
            $this->generateIcon('dropbox', self::DROPBOX);
            $this->generateIcon('facebook', self::FACEBOOK);
            $this->generateIcon('github', self::GITHUB);
            $this->generateIcon('google', self::GOOGLE);
            $this->generateIcon('instagram', self::INSTAGRAM);
            $this->generateIcon('linkedin', self::LINKEDIN);
            $this->generateIcon('twitter', self::TWITTER);

            $this->line('Icons regenerated');
            
            // Reset the db
            DB::table('users')->truncate();
            DB::table('oauth_access_tokens')->truncate();
            DB::table('twofaccounts')->truncate();
            DB::table('options')->truncate();
            
            // Seed the db
            $this->callSilent('db:seed', [
                '--class' => 'DemoSeeder'
            ]);

            $this->line('Database cleaned and seeded');
            $this->info('Demo app refreshed');
        }
        else {
            $this->comment('Bad confirmation word, nothing appened');
        }
    }

    private static function generateIcon($serviceName, $base64icon) {
        // $image = str_replace('data:image/png;base64,', '', $image);
        // $image = str_replace(' ', '+', $image);

        Storage::put('public/icons/' . $serviceName . '.png', base64_decode($base64icon));
    }

    const AMAZON = '';

    const APPLE = '';

    const DROPBOX = '';

    const FACEBOOK = '';

    const GITHUB = '';

    const GOOGLE = '';

    const INSTAGRAM = '';

    const LINKEDIN = '';

    const TWITTER = '';

}